import React, { useState, useEffect } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  const [isData, setData] = useState([])

  useEffect(() => {
    fetch('/api').then(
      res => res.json()
    ).then(data => setData(data))
  }, [])

  var MLB = []

  MLB = isData.headerMLB

  var array = ["1", "2", "3"]

  return (
    <div className="App">
      {console.log(array[0])}
    </div>
  );
}

export default App;
